INSERT INTO `movies` (`id`, `userId`, `tmdbId`, `title`, `overview`, `popularity`, `releaseDate`, `voteAverage`, `backdropPath`, `posterPath`, `isFeatured`, `dateCreated`, `dateUpdated`) VALUES
(198, 45, 17165, '劇場版 BLEACH Fade to Black 君の名を呼ぶ', 'A mysterious reiatsu (spiritual particle) explosion occurs in the center of Seireitei in Soul Society, causing it to be destroyed. At the exact same time, a major change overwhelms Kuchiki Rukia, which leaves her losing something important inside. Urahara Kisuke sends Kurosaki Ichigo to Soul Society to investigate the disturbance. Upon reaching Seireitei, Ichigo is attacked by his ally shinigamis.', 19.721, '2008-12-13', 7.092, 'https://image.tmdb.org/t/p/original//4RnhZgXAwvPR1P3MYj3rLfW3kts.jpg', 'https://image.tmdb.org/t/p/original//486O7Sn110CsaqF46hJpZDOqDZ3.jpg', 0, '2024-12-18 15:55:26', '0000-00-00 00:00:00'),
(199, 45, 900667, 'ONE PIECE FILM RED', 'Uta — the most beloved singer in the world. Her voice, which she sings with while concealing her true identity, has been described as “otherworldly.” She will appear in public for the first time at a live concert. As the venue fills with all kinds of Uta fans — excited pirates, the Navy watching closely, and the Straw Hats led by Luffy who simply came to enjoy her sonorous performance — the voice that the whole world has been waiting for is about to resound.', 69.36, '2022-08-06', 7.201, 'https://image.tmdb.org/t/p/original//6clQoxgYxinQJeDVw504Zn4Ff2q.jpg', 'https://image.tmdb.org/t/p/original//ogDXuVkO92GcETZfSofXXemw7gb.jpg', 1, '2024-12-18 15:56:44', '0000-00-00 00:00:00'),
(200, 45, 20982, '劇場版 NARUTO -ナルト- 疾風伝', 'Demons that once almost destroyed the world, are revived by someone. To prevent the world from being destroyed, the demon has to be sealed and the only one who can do it is the shrine maiden Shion from the country of demons, who has two powers; one is sealing demons and the other is predicting the deaths of humans. This time Naruto\'s mission is to guard Shion, but she predicts Naruto\'s death. The only way to escape it, is to get away from Shion, which would leave her unguarded, then the demon, whose only goal is to kill Shion will do so, thus meaning the end of the world. Naruto decides to challenge this \"prediction of death.\"', 42.154, '2007-08-04', 7.393, 'https://image.tmdb.org/t/p/original//sZIJkZPKySo398Me4HLeUM7eCy0.jpg', 'https://image.tmdb.org/t/p/original//vDkct38sSFSWJIATlfJw0l3QOIR.jpg', 0, '2024-12-18 15:57:04', '0000-00-00 00:00:00'),
(201, 45, 1361184, 'Dragon Ball DAIMA', 'Mysteriously transformed into mini versions of themselves, Goku and his friends travel to the Demon Realm to uncover the truth and find a cure.  The world English dub premiere of Dragon Ball DAIMA, the newest series in the Dragon Ball universe, featuring the first three episodes of the series. Before the film, there will be a special introduction from the Japanese voice of Goku, Masako Nozawa.', 76.234, '2024-11-10', 8, 'https://image.tmdb.org/t/p/original//yCTVy8pA2kxHAjkj8JTgSSbL1UU.jpg', 'https://image.tmdb.org/t/p/original//cVxwxuKI6yXsB8zuGj6cDiL8GtU.jpg', 0, '2024-12-18 15:57:26', '0000-00-00 00:00:00'),
(202, 45, 299536, 'Avengers: Infinity War', 'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.', 254.239, '2018-04-25', 8.243, 'https://image.tmdb.org/t/p/original//mDfJG3LC3Dqb67AZ52x3Z0jU0uB.jpg', 'https://image.tmdb.org/t/p/original//7WsyChQLEftFiDOVTGkv3hFpyyt.jpg', 0, '2024-12-18 15:58:14', '0000-00-00 00:00:00'),
(203, 45, 299534, 'Avengers: Endgame', 'After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos\' actions and restore order to the universe once and for all, no matter what consequences may be in store.', 89.258, '2019-04-24', 8.248, 'https://image.tmdb.org/t/p/original//7RyHsO4yDXtBv1zUU3mTpHeQ0d5.jpg', 'https://image.tmdb.org/t/p/original//or06FN3Dka5tukK1e9sl16pB3iy.jpg', 0, '2024-12-18 15:58:27', '0000-00-00 00:00:00'),
(204, 45, 24428, 'The Avengers', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', 113.672, '2012-04-25', 7.724, 'https://image.tmdb.org/t/p/original//9BBTo63ANSmhC4e6r62OJFuK2GL.jpg', 'https://image.tmdb.org/t/p/original//RYMX2wcKCBAr24UyPD7xwmjaTn.jpg', 0, '2024-12-18 15:59:07', '0000-00-00 00:00:00'),
(205, 45, 99861, 'Avengers: Age of Ultron', 'When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.', 73.643, '2015-04-22', 7.274, 'https://image.tmdb.org/t/p/original//6YwkGolwdOMNpbTOmLjoehlVWs5.jpg', 'https://image.tmdb.org/t/p/original//4ssDuvEDkSArWEdyBl2X5EHvYKU.jpg', 0, '2024-12-18 15:59:20', '0000-00-00 00:00:00');
